import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { FaBars, FaTimes, FaUserCircle } from "react-icons/fa";

export default function Navbar({ user, logout }) {
  const navigate = useNavigate();
  const [menuOpen, setMenuOpen] = useState(false);

  const safeName = user?.name || "User";
  const role = user?.role;

  const handleLogout = () => {
    localStorage.removeItem("token");
    localStorage.removeItem("user");
    localStorage.removeItem("role");
    localStorage.removeItem("userId");

    logout && logout();
    navigate("/login");
  };

  return (
    <nav className="bg-blue-600 sticky top-0 z-50 text-white shadow-md">
      <div className="max-w-7xl mx-auto px-4 py-3 flex justify-between items-center">

        {/* Logo */}
        <Link to="/" className="font-bold text-2xl">
          JobBoard
        </Link>

        {/* Desktop Menu */}
        <div className="hidden md:flex items-center gap-6">

          {!user && (
            <>
              <Link to="/login" className="hover:underline">
                Login
              </Link>
              <Link
                to="/register"
                className="bg-green-500 px-4 py-2 rounded hover:bg-green-600 transition"
              >
                Register
              </Link>
            </>
          )}

          {user && (
            <>
              {/* User Info */}
              <div className="flex items-center gap-2 font-medium">
                <FaUserCircle size={22} />
                {safeName} ({role})
              </div>

              {/* Candidate Links */}
              {role === "candidate" && (
                <Link to="/candidate-dashboard" className="hover:underline">
                  My Applications
                </Link>
              )}

              {/* Employer Links */}
              {role === "employer" && (
                <>
                  <Link to="/employer" className="hover:underline">
                    Post Job
                  </Link>
                  <Link to="/employer/jobs" className="hover:underline">
                    My Jobs
                  </Link>
                </>
              )}

              {/* Logout */}
              <button
                onClick={handleLogout}
                className="bg-red-500 px-4 py-2 rounded hover:bg-red-600 transition"
              >
                Logout
              </button>
            </>
          )}
        </div>

        {/* Mobile Menu Button */}
        <button
          className="md:hidden"
          onClick={() => setMenuOpen(!menuOpen)}
        >
          {menuOpen ? <FaTimes size={24} /> : <FaBars size={24} />}
        </button>
      </div>

      {/* Mobile Dropdown */}
      {menuOpen && (
        <div className="md:hidden bg-blue-700 px-4 py-4 space-y-3">

          {!user && (
            <>
              <Link to="/login" className="block hover:underline">
                Login
              </Link>
              <Link
                to="/register"
                className="block bg-green-500 px-4 py-2 rounded hover:bg-green-600 transition"
              >
                Register
              </Link>
            </>
          )}

          {user && (
            <>
              <p className="font-medium border-b border-blue-500 pb-2">
                <FaUserCircle className="inline mr-2" />
                {safeName} ({role})
              </p>

              {role === "candidate" && (
                <Link to="/candidate-dashboard" className="block hover:underline">
                  My Applications
                </Link>
              )}

              {role === "employer" && (
                <>
                  <Link to="/employer" className="block hover:underline">
                    Post Job
                  </Link>
                  <Link to="/employer/jobs" className="block hover:underline">
                    My Jobs
                  </Link>
                </>
              )}

              <button
                onClick={handleLogout}
                className="w-full bg-red-500 px-4 py-2 mt-2 rounded hover:bg-red-600 transition"
              >
                Logout
              </button>
            </>
          )}
        </div>
      )}
    </nav>
  );
}
